export const UserContext = createContext();

export default function User({children}) {
    const usersinit = {
        "qestrnSeq" : "20",
        "trgetSe" : "100209",
        "name": "name",
        "gender": "",
        "school": "",
        "grade": "",
        "email": "",
        "startDtm": 1550466291034,
        "answers": ""
    };

    return (<UserContext.Provider value={usersinit}>{children}</UserContext.Provider>
    );
};
